'''
Evaluate the value of an arithmetic expression in Reverse Polish Notation.

Valid operators are +, -, *, /. Each operand may be an integer or another expression.

Note:

Division between two integers should truncate toward zero.
The given RPN expression is always valid. That means the expression would always evaluate to a result and there won't be any divide by zero operation.
Example 1:

Input: ["2", "1", "+", "3", "*"]
Output: 9
Explanation: ((2 + 1) * 3) = 9
Example 2:

Input: ["4", "13", "5", "/", "+"]
Output: 6
Explanation: (4 + (13 / 5)) = 6
Example 3:

Input: ["10", "6", "9", "3", "+", "-11", "*", "/", "*", "17", "+", "5", "+"]
Output: 22
Explanation: 
  ((10 * (6 / ((9 + 3) * -11))) + 17) + 5
= ((10 * (6 / (12 * -11))) + 17) + 5
= ((10 * (6 / -132)) + 17) + 5
= ((10 * 0) + 17) + 5
= (0 + 17) + 5
= 17 + 5
= 22

'''

class LinkedNode:
    def __init__(self,val):
        self.val = val
        self.next = None
        self.previous = None

class Solution1:
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        if not tokens:
            return
        head = LinkedNode(None)
        pre = head
        for i in range(len(tokens)):
            try:
                val = int(tokens[i])
            except ValueError as e:
                val = tokens[i]
            cur = LinkedNode(val)
            pre.next = cur
            cur.previous = pre
            pre = cur

        node = head.next
        while node:
            if isinstance(node.val,int):
                node = node.next
            else:
                second = node
                while second and not isinstance(second.val,int):
                    second = second.previous
                first = second.previous
                while first and not isinstance(first.val,int):
                    first = first.previous
                parent = first.previous
                newNode = LinkedNode(self.cal(first.val,second.val,node.val))
                parent.next = newNode
                newNode.previous = parent
                newNode.next = node.next
                if node.next:
                    node.next.previous = newNode
                node = newNode
        return head.next.val

    def cal(self,a,b,operator):
        if operator == '+':
            return a + b
        if operator == '-':
            return a - b
        if operator == '/':
            if a == 0:
                return 0
            if a > 0 and b > 0 or (a < 0 and b < 0):
                return a // b
            return abs(a) // abs(b) * (-1)
        if operator == '*':
            return a * b


