class Solution2:
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        index = 0
        while index < len(tokens):
            try:
                val = int(tokens[index])
                index += 1
            except ValueError as e:
                second = index - 1
                while True:
                    if tokens[second] is None:
                        second -= 1
                        continue
                    try:
                        num2 = int(tokens[second])
                        break
                    except ValueError as e:
                        second -= 1
                first = second - 1
                while True:
                    if tokens[first] is None:
                        first -= 1
                        continue
                    try:
                        num1 = int(tokens[first])
                        break
                    except ValueError as e:
                        first -= 1
                tokens[index] = self.cal(num1,num2,tokens[index])
                tokens[first] = tokens[second] = None
        return int(tokens[-1])


    def cal(self,a,b,operator):
        if operator == '+':
            return a + b
        if operator == '-':
            return a - b
        if operator == '/':
            if a == 0:
                return 0
            if a > 0 and b > 0 or (a < 0 and b < 0):
                return a // b
            return abs(a) // abs(b) * (-1)
        if operator == '*':
            return a * b


class Solution:
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        stack = []
        index = 0
        while index < len(tokens):
            if tokens[index].isdigit() or (tokens[index].startswith('-') and len(tokens[index]) > 1):
                stack.append(int(tokens[index]))
            else:
                second = stack.pop()
                first = stack.pop()
                stack.append(self.cal(first, second, tokens[index]))
            index += 1
        return stack[-1]

    def cal(self,a,b,operator):
        if operator == '+':
            return a + b
        if operator == '-':
            return a - b
        if operator == '/':
            if a == 0:
                return 0
            if a > 0 and b > 0 or (a < 0 and b < 0):
                return a // b
            return abs(a) // abs(b) * (-1)
        if operator == '*':
            return a * b


